package yz.cool.towerverse.official.asset

import yz.cool.towerverse.gameobject.ImageAsset
import yz.cool.towerverse.official.OfficialMod
import yz.cool.towerverse.sdk.ModFile

/**
 * Because the official content is not JVM-only unlike mods, we need to embed asset data directly in the game object
 * itself instead of loading it afterwards.
 */
object OfficialAsset : ModFile(OfficialMod) {
    val grassBackground by ImageAsset {
        content = ""
    }
    val dirtBackground by ImageAsset {
        content = ""
    }
    val stoneBackground by ImageAsset {
        content = ""
    }

    val soldierImage by ImageAsset {
        content = ""
    }
    val soldierTurretImage by ImageAsset {
        content = ""
    }
    val cannonImage by ImageAsset {
        content = ""
    }
    val cannonTurretImage by ImageAsset {
        content = ""
    }

    val basicEnemy by ImageAsset {
        content = ""
    }
    val heavyEnemy by ImageAsset {
        content = ""
    }
    val bossEnemy by ImageAsset {
        content = ""
    }

}